"""
Given a matrix and a target, return the number of non-empty sub matrices that sum to target.
A sub matrix x1, y1, x2, y2 is the set of all cells matrix[x][y] with x1 <= x <= x2 and y1 <= y <= y2.
Two sub matrices (x1, y1, x2, y2) and (x1', y1', x2', y2') are different if they have some coordinate that is different:
 for example, if x1 != x1'
"""
from typing import List


def num_sub_matrix_sum_target(matrix: List[List[int]], target: int) -> int:
    """
    :param matrix: non empty matrix with 1 <= matrix.length <= 100, 1 <= matrix[0].length <= 100 and
        -1000 <= matrix[i][j] <= 1000
    :param target: -10^8 <= target <= 10^8
    :return: number of non empty sub matrices that sum up to target
    """
    n_row, n_col = len(matrix), len(matrix[0])
    # matrix sum of sub matrix: cumulative_sum[r][c] -> sum of sub matrix (0, 0, r - 1, c - 1)
    # padded with zeros on the left and top
    cumulative_sum = [[0] * (n_col + 1) for _ in range(n_row + 1)]
    for r in range(n_row):
        current_row = matrix[r]
        row_sum = 0
        for c, m_rc in enumerate(current_row):
            row_sum += m_rc
            cumulative_sum[r + 1][c + 1] = cumulative_sum[r][c + 1] + row_sum

    return_count = 0
    for r_1 in range(n_row):
        for r_2 in range(r_1 + 1, n_row + 1):
            seen_in_current_section = {0: 1}
            for c_plus_one in range(1, n_col + 1):
                # x is the sum of sub matrix (r_1, 0, r_2, c_plus_one - 1)
                x = cumulative_sum[r_2][c_plus_one] - cumulative_sum[r_1][c_plus_one]
                return_count += seen_in_current_section.get(x - target, 0)
                seen_in_current_section[x] = seen_in_current_section.get(x, 0) + 1

    return return_count


